import { userLabel, userLabelPut } from '@/api/kefu';
export default {
  name: "userLaber",
  props: {
    change: Boolean,
    uid: Number,
    labelList: {
      type: Array,
      default: function _default() {
        return [];
      }
    }
  },
  data: function data() {
    return {
      //  labelList:[],
      activeIds: []
    };
  },
  watch: {
    labelList: function labelList(data) {
      var _this = this;

      data.map(function (el) {
        el.label.map(function (label) {
          if (label.disabled) {
            _this.activeIds.push(label.id);
          }
        });
      });
    }
  },
  methods: {
    selectLabel: function selectLabel(label) {
      if (label.disabled) {
        var index = this.activeIds.indexOf(label.id);
        this.activeIds.splice(index, 1);
        label.disabled = false;
      } else {
        this.activeIds.push(label.id);
        label.disabled = true;
      }
    },
    // 确定
    subBtn: function subBtn() {
      var _this2 = this;

      var unLaberids = [];
      this.labelList.map(function (item) {
        item.label.map(function (i) {
          if (i.disabled == false) {
            unLaberids.push(i.id);
          }
        });
      });
      userLabelPut(this.uid, {
        label_ids: this.activeIds,
        un_label_ids: unLaberids
      }).then(function (res) {
        _this2.$Message.success(res.msg);

        _this2.$emit('editLabel', false);
      }).catch(function (error) {
        _this2.$Message.error(error.msg);
      });
    },
    close: function close() {
      this.$emit("closeChange", false);
    }
  }
};
